import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { Button, Card, Container, Row, Col, Alert, Spinner } from 'react-bootstrap'; // Bootstrap components

const Dashboard = () => {
  const [message, setMessage] = useState('');
  const [clubs, setClubs] = useState([]);
  const [events, setEvents] = useState([]);
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      setLoading(true);
      // Fetch User-Specific Data (Clubs, Events, Resources)
      axios
        .get('http://localhost:8000/dashboard', {
          headers: { Authorization: `Bearer ${token}` },
        })
        .then((response) => {
          setMessage(response.data.message);
          // Fetch User Clubs
          fetchAllClubs(token);
          // Fetch User Events
          fetchAllEvents(token);
          // Fetch User Resources
          fetchAllResources(token);
        })
        .catch(() => {
          setMessage('Access denied. Please log in.');
          setLoading(false);
        });
    } else {
      setMessage('Access denied. Please log in.');
      setLoading(false);
    }
  }, []);

  // Fetch all Clubs
  const fetchAllClubs = (token) => {
    axios
      .get('http://localhost:8000/clubs', {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        setClubs(response.data.clubs);
      })
      .catch((err) => {
        console.error('Error fetching clubs:', err);
        setMessage('Error loading clubs.');
      })
      .finally(() => setLoading(false));
  };

  // Fetch all Events
  const fetchAllEvents = (token) => {
    axios
      .get('http://localhost:8000/events', {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        setEvents(response.data.events);
      })
      .catch((err) => {
        console.error('Error fetching events:', err);
        setMessage('Error loading events.');
      });
  };

  // Fetch all Resources
  const fetchAllResources = (token) => {
    axios
      .get('http://localhost:8000/resources', {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((response) => {
        setResources(response.data.resources);
      })
      .catch((err) => {
        console.error('Error fetching resources:', err);
        setMessage('Error loading resources.');
      });
  };

  // Handle Logout
  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <Container className="mt-5">
      <h1 className="text-center mb-4">Dashboard</h1>

      {/* Message */}
      {message && <Alert variant="info">{message}</Alert>}

      {/* Loading Spinner */}
      {loading && (
        <div className="d-flex justify-content-center my-5">
          <Spinner animation="border" variant="primary" />
        </div>
      )}

      {/* View All Clubs, Events, Resources Buttons */}
      {!loading && (
        <div className="text-center mb-4">
          <Button variant="primary" onClick={() => fetchAllClubs(localStorage.getItem('token'))}>View All Clubs</Button>
          <Button variant="success" className="mx-2" onClick={() => fetchAllEvents(localStorage.getItem('token'))}>View All Events</Button>
          <Button variant="warning" onClick={() => fetchAllResources(localStorage.getItem('token'))}>View All Resources</Button>
        </div>
      )}

      {/* Clubs Section */}
      <h2 className="mt-4">All Clubs</h2>
      <Row>
        {clubs.map((club) => (
          <Col key={club.club_id} sm={12} md={6} lg={4}>
            <Card className="mb-4">
              <Card.Body>
                <Card.Title>{club.club_name}</Card.Title>
                <Card.Text>{club.description}</Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      {/* Events Section */}
      <h2 className="mt-4">All Events</h2>
      <Row>
        {events.map((event) => (
          <Col key={event.event_id} sm={12} md={6} lg={4}>
            <Card className="mb-4">
              <Card.Body>
                <Card.Title>{event.event_name}</Card.Title>
                <Card.Text>{event.event_description}</Card.Text>
                <Card.Text><strong>Date:</strong> {new Date(event.event_date).toLocaleString()}</Card.Text>
                <Card.Text><strong>Location:</strong> {event.location}</Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      {/* Resources Section */}
      <h2 className="mt-4">All Resources</h2>
      <Row>
        {resources.map((resource) => (
          <Col key={resource.resource_id} sm={12} md={6} lg={4}>
            <Card className="mb-4">
              <Card.Body>
                <Card.Title>{resource.title}</Card.Title>
                <Card.Text><strong>Type:</strong> {resource.type}</Card.Text>
                <Card.Text><strong>Uploaded on:</strong> {new Date(resource.upload_date).toLocaleString()}</Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>

      {/* Actions */}
      <div className="text-center mt-5">
        <Button variant="danger" onClick={handleLogout}>Logout</Button>
      </div>
    </Container>
  );
};

export default Dashboard;
